import React, { useState } from 'react';
import './App.css';
import { makeStyles } from '@material-ui/core/styles';
import CssBaseline from '@material-ui/core/CssBaseline';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Paper from '@material-ui/core/Paper';
import CircularProgress from '@material-ui/core/CircularProgress';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import Form from './Form';

const useStyles = makeStyles((theme) => ({
  appBar: {
    position: 'relative',
  },
  layout: {
    width: 'auto',
    marginLeft: theme.spacing(2),
    marginRight: theme.spacing(2),
    [theme.breakpoints.up(600 + theme.spacing(2) * 2)]: {
      width: 600,
      marginLeft: 'auto',
      marginRight: 'auto',
    },
  },
  paper: {
    marginTop: theme.spacing(3),
    marginBottom: theme.spacing(3),
    padding: theme.spacing(2),
    [theme.breakpoints.up(600 + theme.spacing(3) * 2)]: {
      marginTop: theme.spacing(6),
      marginBottom: theme.spacing(6),
      padding: theme.spacing(3),
    },
  },
  stepper: {
    padding: theme.spacing(3, 0, 5),
  },
  buttons: {
    display: 'flex',
    justifyContent: 'flex-end',
  },
  button: {
    marginTop: theme.spacing(3),
    marginLeft: theme.spacing(1),
  },
}));

function App() {
  const classes = useStyles();
  const [data, setData] = useState({
    firstName: '',
    lastName: '',
    email: '',
    street: '',
    city: '',
    state: '',
    zip: '',
    country: '',
    phone: '',
    amount: 0
  });

  const [isLoading, setIsLoading] = useState(false);

  function handleChange(e) {
    const updateData = {
      ...data,
      [e.target.name]: e.target.value
    }
    setData(updateData);
    // console.log(updateData);
  }

  function handleSubmit(e) {
    e.preventDefault();
    setIsLoading(true);
    const requestOptions = {
      method: 'POST',
      mode: 'cors',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(data)
    };
    fetch('http://localhost:5000/api/token', requestOptions)
      .then(response => response.json())
      .then(result => {
        // console.log(result);
        const token = result.token;
        const billingAddress = {
          city: data.city,
          street: data.street,
          zip: data.zip,
          country: 'US',
          state: 'NY'
        };

        const customer = {
          firstName: data.firstName,
          lastName: data.lastName,
          email: data.email,
          phone: data.phone,
          dateOfBirth: {
            day: 4,
            month: 5,
            year: 1998
          }
        };

        function uuidv4() {
          return 'xxxxxxxx-xxxx-4xxx-yxxx-xxxxxxxxxxxx'.replace(/[xy]/g, function (c) {
            let r = Math.random() * 16 | 0, v = c == 'x' ? r : (r & 0x3 | 0x8);
            return v.toString(16);
          });
        }

        const uuid = uuidv4();
        setIsLoading(false);
        console.log(window.checkout(token, billingAddress, customer, uuid, data.amount));
      });
  }

  return (
    <React.Fragment>
      <CssBaseline />
      <AppBar position="absolute" color="default" className={classes.appBar}>
        <Toolbar>
          <Typography variant="h6" color="inherit" noWrap>
            ROIIM Assignment
          </Typography>
        </Toolbar>
      </AppBar>
      <main className={classes.layout}>
        <Paper className={classes.paper}>
          <Typography component="h1" variant="h4" align="center" style={{ marginBottom: '27px', textDecoration: 'underline' }}>
            Checkout
          </Typography>
          <form onSubmit={handleSubmit}>
            <Form data={data} handleChange={handleChange} />
            <div className={classes.buttons}>
              {
                isLoading ?
                  <CircularProgress />
                  :
                  <Button
                    variant="contained"
                    color="primary"
                    className={classes.button}
                    type="submit"
                  >
                    Pay
              </Button>}
            </div>
          </form>
        </Paper>
      </main>
    </React.Fragment>
  );
}

export default App;
